fr:mainmatter.fr:p:
For the right triangle identity, observe that 




    \usepackage{tikz, tikz-cd, mathtools, amssymb}
  \usetikzlibrary{shapes.geometric}
  \usetikzlibrary{calc}
  \usetikzlibrary{matrix}
  \usetikzlibrary{decorations.markings}

  \tikzset{
    % basics
    square/.style={draw, regular polygon, regular polygon sides=4},
    triangle/.style={draw, regular polygon, regular polygon sides=3},
  }

  \tikzset{
    % string diagrams
    state/.style={triangle, shape border rotate=180, anchor=north},
    costate/.style={triangle, anchor=south},
    morphism/.style={draw, rectangle},
    over/.style={
      draw=white,
      double=black,
      % default is .4pt
      line width=1.2pt,
      double distance=.4pt,
      text=black
    },
  }

  \tikzset{ 
    % tables
    % https://tikz.net/tikz-table/
    table/.style={
        matrix of nodes,
        row sep=-\pgflinewidth,
        column sep=-\pgflinewidth,
        nodes={
            rectangle,
            draw=black,
            align=center
        },
        minimum height=1.5em,
        text depth=0.5ex,
        text height=2ex,
        nodes in empty cells,
%%
        every even row/.style={
            nodes={fill=gray!20}
        },
        column 1/.style={
            nodes={font=\bfseries}
        },
        row 1/.style={
            nodes={
                fill=black,
                text=white,
                font=\bfseries
            }
        }
    }
  }


    \begin {tikzcd}
      G\ar [rr, "\eta  G"]\ar [dr, "\gamma ^{-1}", pos=.6]\ar [ddrr, bend right,
      "1_G"'] && GFG\ar [d, "GF\gamma ^{-1}"']\ar [dd, "G\epsilon ", bend left=50] \\
      & G\ar [r, "\eta  G"]\ar [dr, "\gamma "'] & GFG\ar [d, "G\mu "'] \\
      & & G\makebox [0pt][l]{.}
    \end {tikzcd}


 commutes: the top square is naturality of \eta  G, the left triangle is
  the inverse law for \gamma , the bottom triangle is the definition of
  \gamma , and the right triangle is the definition of \epsilon .

For the left triangle identity, we show that (\epsilon  F)\circ  (F \eta )
  is idempotent; since idempotent isomorphisms are
  identities, this completes the proof. The following diagram
  commutes: 




    \usepackage{tikz, tikz-cd, mathtools, amssymb}
  \usetikzlibrary{shapes.geometric}
  \usetikzlibrary{calc}
  \usetikzlibrary{matrix}
